import React from "react";
import { Categories } from "../categories/Categories";
import { Carousel } from "./Carousel";
import { Category } from "../category/Category";

export const Home = () => {
  return (
    <>
      <Carousel />
      <Categories />
      <h1
        style={{
          textAlign: "center",
          fontSize: "2rem",
          fontWeight: "450",
          color: "#333",
        }}
      >
        Featured Categories
      </h1>
      <Category category="essentials" />
    </>
  );
};
